import React from 'react';

const ContactUs = () =>{
  return(
    <section id="contact" className="row">
      <h1 className="col-md-12 text-center">Contact Us</h1>
      <div className="offset-md-3 col-md-6">
        <h5><strong>Hours of Operations</strong></h5>
        <p>Monday - Friday</p> 
        <p className="text-center">7AM to 4:30PM</p>
        <h5 className="text-center">Saturday - Sunday</h5>
        <p className="text-center">Closed</p>
        <h5 className="text-center">Email: </h5>
        <h5 className="text-center">Phone Number: </h5>
      </div>
      <div className="col-md-12 text-center">
        <h5><strong>Address:</strong></h5>
        <p>115 W. Bel Air Ave,</p>
        <p>Aberdeen, MD 21001</p>
      </div>
    </section>
  );
}

export default ContactUs;
